package Regal;

public class Buch {
	
	private int hoehe;
	private int breite;
	private int tiefe;
	private double preis;
	private String name;
	private String ISBN;
	private int bNummer;
	

	public Buch() {
		// TODO Auto-generated constructor stub
	}

	public int getHoehe() {
		return hoehe;
	}

	public void setHoehe(int hoehe) {
		this.hoehe = hoehe;
	}

	public int getBreite() {
		return breite;
	}

	public void setBreite(int breite) {
		this.breite = breite;
	}

	public int getTiefe() {
		return tiefe;
	}

	public void setTiefe(int tiefe) {
		this.tiefe = tiefe;
	}

	public double getPreis() {
		return preis;
	}

	public void setPreis(double preis) {
		this.preis = preis;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getISBN() {
		return ISBN;
	}

	public void setISBN(String iSBN) {
		ISBN = iSBN;
	}

	public int getbNummer() {
		return bNummer;
	}

	public void setbNummer(int bNummer) {
		this.bNummer = bNummer;
	}

	

}
